import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Routes, Router } from 'react-router-dom';
import Hero from './components/Hero';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Hero />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
